        <ListGroupItem className="ps-0 border-Ø d-flex align-items-center gap-3"> <h6 className="mb-0 d-flex align-items-center gap-2"> <span> <i class="ri-mail-line"></i> </span> Email: </h6> <p className="mb-0">awe@gmail.com</p> </ListGroupItem>
        <ListGroupItem className="ps-0 border-Ø d-flex align-items-center gap-3"> <h6 className="mb-0 d-flex align-items-center gap-2"> <span> <i class="ri-phone-line"></i> </span> Phone: </h6> <p className="mb-0">+88092771727</p> </ListGroupItem></ListGroup>
          </Col>

<Col lg='12'>
<p className="copyright">CopyRight</p></Col>
        </Row>
      </Container>
    </footer>
  );
};
